```python
    def _ConfirmCalibrationObject(self, calibrationParameters, webstackclient=None):
        # type: (calibrationParametersType, Any) -> None
        """Does checks for calibrationBoardPath. If webstackclient is specified, also checks that it exists on the webstack
        """
        if not calibrationParameters or not calibrationParameters.get('calibrationBoardSource') or not \
            calibrationParameters['calibrationBoardSource'].get('calibrationBoardPath'):
            raise CalibrationError(
                _(
                    'For calibration with robot to work "calibrationBoardSource"/"calibrationBoardPath" needs to be defined.'
                )
            )

        if calibrationParameters['calibrationBoardSource'].get('calibrationBoardSourceType', 'scene') != 'scene':
            raise CalibrationError(
                _(
                    'For calibration with robot to work "calibrationBoardSource"/"calibrationBoardSourceType" needs to be "scene", currently it is "%s"'
                ) % (
                    calibrationParameters['calibrationBoardSource'].get('calibrationBoardSourceType', 'scene'),)
            )

        calibrationBoardPath = calibrationParameters['calibrationBoardSource'].get('calibrationBoardPath')
        calibrationBoardPathParts = ParseCalibrationBoardPath(calibrationBoardPath)
        calibobjectname = calibrationBoardPathParts[0]
        if webstackclient is not None:
            instobjects = webstackclient.GetScene(self._scenepk, fields='instobjects').get('instobjects', [])
            calibobjectpk = None
            for instobject in instobjects:
                if instobject['name'] == calibobjectname:
                    calibobjectpk = instobject['object_pk']

            if calibobjectpk is None:
                raise CalibrationManagerError(
                    _("The calibration object with name=%s cannot be found in the scene.") % calibobjectname
                )


